import React from 'react';
import styled from 'styled-components';
import { colors } from '../utilities';
import Event from '../elements/svg/Event';
import PriceEvent from '../elements/svg/PriceEvent';
import Percent from '../elements/svg/Percent';


const NegocioRegistroBase = ({className}) => {
    return (
        <div className={className}>
            <div className="register">
                <div className="list">
                    <li className="txt-register">Toda la documentación debe enviarse por vía electrónica (e-mail, whatsapp, facebook, etc).</li>
                    <li className="txt-register">Identificación oficial vigente y legible (INE, Pasaporte, Cédula Profesional).</li>
                    <li className="txt-register">Comprobante de domicilio con antiguedad máxima de tres meses.</li>
                    <li className="txt-register">Tres referencias personales que avalen conocerlo y puedan validar su domicilio.</li>
                </div>
            </div>
            <div className="left">
                <Event className="left_icon" size={65}/>
            </div>
            <div className="center">
                <PriceEvent className="center_icon" size={65}/>
            </div>
            <div className="right">
                <Percent className="right_icon" size={65}/>
            </div>

        </div>
    );
};

const NegocioRegistro = styled(NegocioRegistroBase)`
    position: relative;
    width: 100%;
    margin-top: 8rem;


    .list{
        display: inline-block;
        margin-top: 2.5rem;
        margin-left: 1rem;
        list-style-type: square;
    }


    .register{
        width: 95%;
        height: 5rem;
        margin: 0.5rem 0 2.5rem 1rem;
    }


    .txt-register{
        color: ${colors.white_1};
        font-size: 1rem;
        margin: 0 0 0 2rem;
        line-height: 2.5rem;
        padding-bottom: 0.7rem;
    }

    .left{
        width: 33%;
        margin: 15.5rem 0rem 0rem 0rem;
        display: inline-block;
        text-align: center;

        .left_icon{
            display: block;
            margin: 0 auto;
        }
    }

    .center{
        width: 33%;
        margin: 15.5rem 0rem 0rem 0rem;
        display: inline-block;
        text-align: center;

        .center_icon{
            display: block;
            margin: 0 auto;
        }

    }

    .right{
        width: 33%;
        margin: 15.5rem 0rem 0rem 0rem;
        display: inline-block;
        text-align: center;

        .right_icon{
            display: block;
            margin: 0 auto;
        }

    }



`



export default NegocioRegistro;
